from typing import List# from db.dto import Customer, AdminUserfrom db.transaction import Transactionsfrom utils import generate_unique_idclass User(Transactions):	def __init__(self, unique_id: str = None, chat_id: str = None, name: str = None, phone: str = None,	             role: str = None, age: int = None, language: str = None):		super().__init__()		self.id = unique_id or generate_unique_id()		self.chat_id = chat_id		self.name = name		self.phone = phone		self.role = role		self.age = age		self.language = language		def insert_into_user(self):		sql: str = 'insert into user(id,chat_id, phone_number, role,name, age,language) VALUES (?,?,?,?,?,?,?)'		params = (self.id, self.chat_id, self.phone, self.role, self.name, self.age, self.language)		return self.execute(sql, parameters=params, commit=True)		def registered_user_chat_id(self):		sql: str = "select * from user where chat_id=?"		params = (self.chat_id,)		return self.execute(sql, parameters=params, fetchone=True)